import React from "react";
import user from "./Arry";
import "./App.css";

function App(){
  return(<>
   <h1>{user.name}</h1>
   <img className="image" src={user.Url} alt="image"/>
   <h3>age of manoj is {user.age} years old</h3>

</>
  ) 
};
export default App
